import { Button } from "./Button"
import { useState } from "react"

export function Header(){

    let [content,setContent]=useState('нажми на кнопку(слева направо)')
    
    function handleclick(type){
        console.log(type)
        setContent(type)
    }
    
    return(
        <div className="header">
        <img src="./img/смаилик.jpg" alt="" />
        <div className="header-button">
        <Button onClick={()=>handleclick('не')}>---</Button>
        <Button onClick={()=>handleclick('нажимай')}>---</Button>
        <Button onClick={()=>handleclick('сюда')}>---</Button>
        <p>{content}</p>
        </div>
        </div>
    )
}
